class Audio {
  constructor ({ name = '', loop = false }) {
    this.init({ name, loop })
  }

  init ({ name = '', loop = false }) {
    this.name = name
    this.loop = loop
    this.audioList = {
      success: 'data:audio/mp3;base64,',
      miss: 'data:audio/mp3;base64,',
      over: 'data:audio/mp3;base64,'
    }

    this.gameAudio = document.querySelector('.game-audio')
  }

  play ({ name = this.name, loop = this.loop }) {
    if (!this.audioList[name]) {
      return false
    }
    
    this.stop()
    this.gameAudio.src = this.audioList[name]
    this.gameAudio.loop = loop
    this.gameAudio.play()
  }

  stop () {
    this.gameAudio.pause()
    this.gameAudio.currentTime = 0
  }
}

export default Audio